import React from "react";
import axios from "axios";

const BASE_API = "http://localhost:3001";

function App(){
    
    async function handleOnClick(event){
        const value = event.target.value;
        if(value === "login"){
            try{
                await axios.get(BASE_API);
            }catch(err){
                console.log(err);
            }
        }else if(value === "register"){
            try{
                await axios.get(BASE_API);
            }catch(err){
                console.log(err);
            }
        }
    }

    return (
        <div className="login-screen">
            <h1>Welcome</h1>
            <div className="buttons-area">
                <h4>Please login/register to use our app</h4>
                <button onClick={handleOnClick} value="login">Login</button>
                <button onClick={handleOnClick} value="register">Register</button>
            </div>
        </div>
    )
}

export default App;
